import React from 'react';
import './bigLogoImage.css';

class BigLogoImage extends React.Component {
    render() {
    return (
      <div>
        <img className="img-logo mx-auto  d-block"src={"../../images/reef-logo1.png"} alt="big-logo" />
      </div>
    );
  }
}
export default BigLogoImage
